import React from "react";

import Icon from "./icon"

export function Sidebar(props) {
  return (<div className="sidebar">
    <Icon icons={props.icons.homeIcon}  />
    <Icon icons={props.icon.fireIcon}  />
    <Icon icons={props.icons.subscriptionsIcon}  />
    <Icon icons={props.playlist}  />

  </div>)
}
